### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Search Methods for Problem Solving**
   - **State Space Representation**: Understanding how to represent states and transitions in problems like the 8-puzzle.
   - **Search Algorithms**: Depth First Search (DFS), Breadth First Search (BFS), Best First Search, and Hill Climbing.
   - **Heuristics**: Manhattan distance for evaluating states.
   - **Move Generation**: Generating possible moves from a given state.
   - **Goal Testing**: Checking if a state is the goal state.

2. **Genetic Algorithms**
   - **Tour Representations**: Path and adjacency representations of tours.
   - **Crossover Techniques**: Cycle Crossover for generating offspring.
   - **Heuristics**: Nearest Neighbor Heuristic and Greedy Heuristic for constructing tours.
   - **Savings Heuristic**: Calculating savings for optimizing tours.

3. **Traveling Salesman Problem (TSP)**
   - **Distance Matrix**: Using distance matrices to construct TSP tours.
   - **Tour Construction**: Building tours using various heuristics.
   - **Cost Calculation**: Calculating the cost of tours.

#### Important Equations

1. **Manhattan Distance**:
   \[
   \text{Manhattan Distance} = |x_1 - x_2| + |y_1 - y_2|
   \]
   This is used to estimate the distance between two points in a grid.

2. **Cost of a Tour**:
   \[
   \text{Cost} = \sum_{i=1}^{n-1} \text{distance}(city_i, city_{i+1}) + \text{distance}(city_n, city_1)
   \]
   This equation is used to calculate the total cost of a tour in TSP.

3. **Savings in Savings Heuristic**:
   \[
   \text{Savings} = \text{distance}(A, C) + \text{distance}(B, D) - \text{distance}(A, B) - \text{distance}(C, D)
   \]
   This equation calculates the savings when combining two edges into one.

